import React, { useEffect } from 'react'
import { useSelector,useDispatch } from 'react-redux'; 
import { getResultByExamId } from '../../Actions/examAction';
import Loader from '../Loader';
import Error from '../Error';

function Results(exam_id) {
    const dispatch = useDispatch();
    const resultdata = useSelector((state)=>state.getResultByExamIdReducer)
    const {Results,loading,error }= resultdata;
    console.log(Results);

    useEffect(()=>{
       dispatch( getResultByExamId(exam_id))
    },[])
    useEffect(()=>{
      if(Results!=null){
        const user_ids = Results.map((result)=> result.user_id);
        console.log(user_ids)
        // dispatch()
      }
    })
  return (
    <>
        {loading && <Loader/>}
        {error && <Error/>}

    </>
  )
}

export default Results
